import { createPart, PartInputs, PartOutputs } from 'flyde';

type ConcatenateInputs = {
  input1: string;
  input2: string;
};

type ConcatenateOutputs = {
  result: string;
};

const concatenate = async (
  inputs: PartInputs<ConcatenateInputs>,
  outputs: PartOutputs<ConcatenateOutputs>
) => {
  const { input1, input2 } = inputs;

  const result = input1 + input2;

  outputs.result = result;
};

export const concatenatePart = createPart(concatenate);
```

